import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";

interface MyComponentProps {
  data: any;
  setData: any;
  like: any;
  setLikeMock: any;
  addMock: any;
  setAddMock: any;
}

const CartPage: React.FC<MyComponentProps> = ({
  data,
  setData,
  like,
  setLikeMock,
  addMock,
  setAddMock,
}) => {
  const RenderInfoFrom = () => {
    return data.map((element: any) => {
      return (
        <>
          <h2 dangerouslySetInnerHTML={{ __html: element.about }}></h2>
          <p dangerouslySetInnerHTML={{ __html: element.about }}></p>
        </>
      );
    });
  };
  return <RenderInfoFrom />;
};
export default CartPage;
